import { Form, Row, Col, Input, Button, Icon } from 'antd';
import React from 'react';
import './App.css';
import 'antd/dist/antd.css';

class AdvancedSearchForm extends React.Component {
    constructor(props){
        super(props)
        this.state = {
            expand: false,
          };
    }

    // To generate mock Form.Item
    getFields() {
      const { getFieldDecorator } = this.props.form;
      const children = [];
        children.push(
          <Col span={8} key={1} >
            <Form.Item label={"Name"}>
              {getFieldDecorator("who", {
                rules: [
                  {
                    required: true,
                    message: 'Input something!',
                  },
                ],
              })(<Input placeholder="placeholder" />)}
            </Form.Item>
            <Form.Item label={"Description"} key={2} >
              {getFieldDecorator("desc", {
                rules: [
                  {
                    message: 'Input something!',
                  },
                ],
              })(<Input placeholder="placeholder" />)}
            </Form.Item>
          </Col>,
        );
      return children;
    }

    toggle = () => {
      const { expand } = this.state;
      this.setState({ expand: !expand });
    };



    render() {
      const {handleSearch} = this.props;
      const {handleReset} = this.props;
      const {handlegetFileds} = this.props;
      return (
        <Form className="ant-advanced-search-form" onSubmit={handleSearch} style={{margin:20}}>
          <Row gutter={24}>{handlegetFileds()}</Row>
          <Row>
            <Col span={24} style={{ textAlign: 'right' }}>
              <Button type="primary" htmlType="submit">
                Search
              </Button>
              <Button style={{ marginLeft: 8 }} onClick={handleReset}>
                Clear
              </Button>
              <a style={{ marginLeft: 8, fontSize: 12 }} onClick={this.toggle}>
                Collapse <Icon type={this.state.expand ? 'up' : 'down'} />
              </a>
            </Col>
          </Row>
        </Form>
      );
    }
  }

const WrappedAdvancedSearchForm = Form.create({ name: 'advanced_search' })(AdvancedSearchForm);

class Myform extends React.Component {

    render(){
        const {data}= this.props
        const {handleSearch} = this.props;
        const {handleReset} = this.props;
        const {handlegetFileds} = this.props;
        return(
         <div>
            <WrappedAdvancedSearchForm data= {data} handleSearch = {handleSearch} handleReset = {handleReset} handlegetFileds = {handlegetFileds} />
          </div>
        )

    }

}

export default Myform
